import logo from './Images/Logo.jpg';
import './App.css';
import Nav from './components/Nav';

function App() {
  return (
    <div>
      <div className='text-center'>
        <img src={logo} className='img-fluid' height={auto} alt="Responsive image" />
      </div>
      <div>
        <Nav />
      </div>
    </div>
  );
}

export default App;
